column2:
In base-8, we perform the addition similarly to base-10, but carrying over when the sum reaches 8.

Starting with the rightmost digit, we have 7+0=7. Moving to the next digit, we have 6+6=12. Since 12 is greater than 7, we carry over the 1 and write down 2. So, the result is 127.

\boxed{127}
